var initialState = [
    {
        id : 1,
        name : "123",
        image : "",
        description: "",
        price : 500,
        inventory : 5
    },
    {
        id : 2,
        name : "123",
        image : "",
        description: "",
        price : 500,
        inventory : 5
    },
    {
        id : 3,
        name : "123",
        image : "",
        description: "",
        price : 500,
        inventory : 5
    },
];

export const reducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
